export {default as PostContainer} from '../components/Posts/PostContainer/PostContainer';
export {default as PostCreate} from '../components/PostCreate/PostCreate';
export {default as AppContext} from '../Context/AppContext';
export {default as PostItem} from '../components/Posts/PostItem/PostItem';
export {default as Header} from '../components/HeaderNavbar/Header';
export {default as Home} from '../components/Home/Home';
export {default as Footer} from '../components/Footer/Footer';
export {default as Login} from '../components/Login/Login';
export {default as Register} from '../components/Register/Register';
export {default as PageNotFound} from '../components/PageNotFound/PageNotFound';

export {default as reducer} from '../Reducer/AppReducer';
export * as actionpayloads from '../Reducer/AppReducer';
export * as actions from '../actions/actions';
